import axios from "axios"
import { useState } from "react"
import { addingNewStudent } from "./api/AddNewStudentService"

export default function StudentListComponent() {
  const[message, setMessage] = useState(null)

    function handleSubmit(){

      addingNewStudent()
            .then((response) => successResponse(response))
            .catch((error) => errorResponse(error))
            .finally(()=> console.log('cleanup'))
  }

  function successResponse(response){

    const data ={

      "student" :[
        {
          "name":"John",
          "last_name":"Doe",
          "age":"25",
          "Occupation":"driver",
        },
        {
          "name":"Jack",
          "last_name":"Brown",
          "age":"24",
          "Occupation":"it"
        },
        {
          "name":"Oliver",
          "last_name":"Black",

          "age":"30",
          "Occupation":"cto"
        },
      ]
    }

  setMessage(
  <div className="container">
      <h1>Students Lists</h1>

      <table className="table">
        <thead>
          <tr>
            <td>Name</td>
            <td>Family Name</td>
            <td>DOB</td>
            <td>Email</td>
            <td>Delete</td>
          </tr>
        </thead>
        <tbody>
        {data.response.data.map((item, i) => (
            <tr key={i}>
              <td>{item.name}</td>
              <td>{item.name}</td>
              <td>{item.name}</td>
              <td>{item.name}</td>
            </tr>
          ))}
        </tbody>
      </table>
  </div>
  )
}

function errorResponse(response){
    console.log(response)

}

  return (
    <div className="StudentList">
      <h2>Click on Student Lists button to fetch all the Students lists maintained by us.</h2>
            <div> 
                <button type="button" name="submit m-5" onClick={handleSubmit}>Student Lists</button>
            </div>
            <div className="text-info">{message}</div>
    </div>
)
}
